import React, { useState, useEffect } from "react";
import { Link } from "react-router-dom";
import { FaHandsHelping, FaInfoCircle, FaUsers, FaGlobeAsia } from "react-icons/fa";
import "./Home.css";

const images = [
  "/images/food-donation.jpg",
  "/images/education.jpg",
  "/images/children-smile.jpg",
  "/images/medical-help.jpg",
];

const Home = () => {
  const [currentIndex, setCurrentIndex] = useState(0);

  // Auto-slide every 4 seconds
  useEffect(() => {
    const interval = setInterval(() => {
      setCurrentIndex((prev) => (prev + 1) % images.length);
    }, 4000);
    return () => clearInterval(interval);
  }, []);

  return (
    <div className="home-container">
      {/* Navbar */}
      <nav className="navbar">
        <div className="logo">üåç Helping Universe</div>
        <div className="nav-links">
          <Link to="/login" className="btn">
            Login
          </Link>
          <Link to="/register" className="btn btn-primary">
            Register
          </Link>
        </div>
      </nav>

      {/* Slideshow */}
      <div className="slideshow">
        <img
          src={images[currentIndex]}
          alt="Helping Universe Slide"
          className="slide-image fade"
        />
        <div className="overlay">
          <h1>Welcome to Helping Universe</h1>
          <p>
            Join us in creating smiles, spreading hope, and changing lives.
          </p>
        </div>
      </div>

      {/* Donate Button Below Images */}
      <div className="donate-section">
        <h2>Be the reason someone smiles today üíñ</h2>
        <Link to="/donate" className="donate-btn">
          Donate Now
        </Link>
      </div>

      {/* Our Sections */}
      <div className="info-sections">
        <h2>Explore Our Work</h2>
        <div className="card-container">
          <Link to="/activities" className="info-card">
            <FaGlobeAsia className="icon" />
            <h3>Our Activities</h3>
            <p>Explore all our missions and social outreach programs.</p>
          </Link>

          <Link to="/about" className="info-card">
            <FaInfoCircle className="icon" />
            <h3>About Us</h3>
            <p>Know our story, values, and goals to make the world better.</p>
          </Link>

          <Link to="/volunteers" className="info-card">
            <FaUsers className="icon" />
            <h3>Our Volunteers</h3>
            <p>Meet the people working tirelessly to help others.</p>
          </Link>

          <Link to="/support" className="info-card">
            <FaHandsHelping className="icon" />
            <h3>Support Us</h3>
            <p>Partner with us to create a lasting positive impact.</p>
          </Link>
        </div>
      </div>

      {/* Footer */}
      <footer className="footer">
        <p>¬© 2025 Helping Universe | Spreading Hope Together üí´</p>
      </footer>
    </div>
  );
};

export default Home;
